package Commands;

public class Test {

        public static void main(String[] args) {
            // Criar a TV
            ElectronicDevice tv = new Tv();
    
            // Criar o comando para ligar a TV
            Command ligarTv = new TurnOnTv(tv);
    
            // Executar o comando de ligar a TV
            ligarTv.execute();  // A TV será ligada
    
            // Agora, se quisermos desfazer a ação, podemos usar o comando desfaz
            ligarTv.undo();  // A TV será desligada
        }
    }
    
}
